import { Cards } from './components/Cards/Cards'
import { Filter } from './components/Filter/Filter'
import cats from './mocks/cats.json'
import './App.css'

function App() {
  return (
    <div className="App">
        <div className='wrapper'>
          <Filter />
          <Cards cats={cats}/>
        </div>

    </div>
  );
}

export default App;
